import React from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom"
import routes from './routes'

interface Props { }

const App: React.FC<Props> = () => {
  return (
    <Router>
      <Switch>
        {routes.map((route, i) => (
          <Route
            key={i}
            path={route.path}
            render={props => (
              // pass the sub-routes down to keep nesting: routes={route.routes}
              <route.component {...props} />
            )}
          />
        ))}
      </Switch>
    </Router>
  )
}

export default App
